import '../Styles/ClientItem.css';

const ClientItem = ({ clients }) => {
  return clients.length === 0 ? (
    <div className='clients-message'>
      <h2>No clients yet</h2>
    </div>
  ) : (
    <div className='appointment-items'>
      <div className='items-header'>
        <p>Date</p>
        <p>Time</p>
        <p>Client</p>
        <p>Technician</p>
        <p>Type</p>
        <p>Status</p>
        <p>Price</p>
      </div>
      {clients.map((appointment) => (
        <div key={appointment.id} className='item'>
          <p>{appointment.date}</p>
          <p>{appointment.time}</p>
          <p>{appointment.client}</p>
          <p>{appointment.technician}</p>
          <p>{appointment.type}</p>
          <p>{appointment.status}</p>
          <p>{appointment.price}</p>
        </div>
      ))}
    </div>
  );
};
export default ClientItem;
